import React from "react";
import "bulma/css/bulma.css";
import Test from "./components/Test";
import Text from "./components/Text";
import Spreeder from "./components/Spreeder";

const App: React.FC = () => {
  return (
    <div>
      <Test />
      <Text />
      <Spreeder />
    </div>
  );
};

export default App;
